    false,nt"url": null,nt"notes": "Dataset developed by California Coastal
    Commission's Melanie Coyne by attaching names to a dynamically segmented coastline
    using the Department of Navigation and Ocean Development (DNOD) (now Department
    of Boating and Waterways) 1977 'Assessment and Atlas of Shoreline Erosion along
    the California Coast' by the State of California Resources Agency. The resulting
    shapefile only contained starting and ending reference units, coastal type, and
    common feature names, the following were recently appended: Ownership, Nearshore
    Description, Shoreline Description, Backshore Description, Development, Role in
    Littoral Cell, Orientation, Sediment Source, Current Beach Width (FT), Historical
    Beach Width (FT).",nt"license_title": null,nt"extras": [{ntt"key":
